      <Box
        style={{
          minHeight: '100vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'flex-start',
          alignItems: 'flex-start',
          textAlign: 'left',
          padding: '5% 0', // Adjust the top padding to account for the navbar
          marginTop: '64px' // Additional margin to push down the content
        }}
      >
        {/* Unstructured */}
        <Typography variant="h6">Unstructured, San Francisco, CA</Typography>
        <Typography variant="subtitle1">Developer Advocate Engineer/Sales Engineer (Jul 2023 - Dec 2023)</Typography>
