          <ListItem>Developed tailored Retrieval Augmented Generation (RAG) systems for clients leveraging GPT4-Turbo or OSS.</ListItem>
          <ListItem>Fine-tuned open-source embedding models and LLMs, including LLama 2, for on-premise systems.</ListItem>
          <ListItem>Implemented LLM solutions on AWS Bedrock and Sagemaker for customers.</ListItem>
          <ListItem>Authored external technical documents, blogs, and social media posts to maximize product usage.</ListItem>
          <ListItem>Led teamâ€™s community outreach program, scaling API adoption from 0 to 3500 users.</ListItem>
          <ListItem>Built and maintained comprehensive technical documentation for OSS and hosted solutions.</ListItem>
        </List>

        {/* Other experiences can be added in a similar format */}
      </Box>
    </Container>
  );
};

export default Experience;
